const addCollapsibleCallouts=()=>{if(isInitialized){console.log("Collapsible Callouts already added!");return}console.log("Adding Collapsible Callouts");const e=document.querySelectorAll("blockquote.callout-collapsible");e.forEach(e=>e.addEventListener("click",e=>{console.log("register collapsible callout event"),e.currentTarget.classList.toggle("callout-collapsed")})),isInitialized=!0}